    false,nt"url": null,nt"notes": " State Legislative Districts (SLDs) are
    the areas from which members are elected to State legislatures. The SLDs embody
    the uppern               (senate) and lower (house) chambers of the state legislature.
    Nebraska has a unicameral legislature and the District of Columbia has a single
    council,n               both of which the Census Bureau treats as upper-chamber
    legislative areas for the purpose of data presentation; there are no data by SLDL
    for eithern               Nebraska or the District of Columbia. A unique three-character
    census code, identified by State participants, is assigned to each SLD within a
    state. Inn               Connecticut, Illinois, Louisiana, Maine, Maryland, Massachusetts,
    Michigan, Ohio, and Puerto Rico, the Redistricting Data Program (RDP) participant
    didn               not define the SLDs to cover all of the state or state equivalent
    area. In these areas with no SLDs defined, the code "ZZZ" has been assigned, which
    isn               treated as a single SLD for purposes of data presentation. The
    boundaries of the 2014 State legislative districts were provided by state-leveln
                  participants through the RDP and reflect the districts used to elect
    members in or prior to the November 2014 election.",nt"license_title": null,nt"extras":
